import './list.css';

const times = [
  { time : '10:00', seat : 30},
  { time : '11:00', seat : 67},
  { time : '12:00', seat : 44},
  { time : '14:00', seat : 16},
  { time : '16:00', seat : 24},
  { time : '18:00', seat : 98},
];

const TimeTable = ({ times = [] }) => (
  <div className="hmb_tbl">
    <table className="kbo">
      <caption>2017 KBO리그 팀순위</caption>
      <thead>
        <tr>
          <th scope="col"><span>시간</span></th>
          <th scope="col"><span>좌석</span></th>
        </tr>
      </thead>
      <tbody>
        {times.map(section => <TimeRow key={section.time} section={section} />)}
      </tbody>
    </table>
  </div>
);

const TimeRow = ({ section }) => {
  const { time, seat } = section

  return (
    <tr>
      <th scope="row"><span>{time}AM</span></th>
      <td><span>{seat}/343</span></td>
    </tr>
  )
}

export default () => <TimeTable times={times} />
